import React, { useState } from 'react';
import { Row, Col, Form, Container, Button } from 'react-bootstrap';
import { Link } from 'react-router-dom';

function Register() {
  const [registerData, setRegisterData] = useState({
    name: '',
    email: '',
    password: '',
    comfirmPassword: '',
  });

  const onChangeHandler = (event) => {
    setRegisterData({
      ...registerData,
      [event.target.name]: event.target.value,
    });
  };
  const [validated, setValidated] = useState(false);

  const onSubmitHandler = (event) => {
    event.preventDefault(); // Prevents the default form submission behavior
    const form = event.currentTarget;
    if (form.checkValidity()) {
      // Form is valid, perform form submission or other actions
      if (registerData.password !== registerData.comfirmPassword) {
        setValidated(false);
      }
    } else {
      setValidated(true); // Set the "validated" state to true to display validation errors
    }
  };

  return (
    <Container className='mt-5'>
      <Row className='justify-content-center'>
        <Col />
        <Col className='text-center'>
          <h2>
            <b>Register</b>
          </h2>
        </Col>
        <Col />
      </Row>
      <Row className='justify-content-center'>
        <Col />
        <Col>
          <Container style={{ width: '400px' }}>
            <Form noValidate validated={validated} onSubmit={onSubmitHandler}>
              <Form.Group controlId='usernameCustomValidation'>
                <Form.Label>Name</Form.Label>
                <Form.Control
                  type='text'
                  name='name'
                  placeholder='Name'
                  required
                  onChange={onChangeHandler}
                  value={registerData.name}
                />
                <Form.Control.Feedback type='invalid'>
                  Please provide a valid username.
                </Form.Control.Feedback>
              </Form.Group>
              <Form.Group className='mt-2' controlId='emailCustomValidation'>
                <Form.Label>Email</Form.Label>
                <Form.Control
                  type='email'
                  name='email'
                  placeholder='Email'
                  required
                  onChange={onChangeHandler}
                  value={registerData.email}
                />
                <Form.Control.Feedback type='invalid'>
                  Please provide a valid email.
                </Form.Control.Feedback>
              </Form.Group>
              <Form.Group
                className='mt-2'
                controlId='passwordCustomValidation01'
              >
                <Form.Label>Password</Form.Label>
                <Form.Control
                  type='password'
                  name='password'
                  placeholder='Password'
                  required
                  onChange={onChangeHandler}
                  value={registerData.password}
                />
                <Form.Control.Feedback type='invalid'>
                  Please provide a password.
                </Form.Control.Feedback>
              </Form.Group>
              <Form.Group
                className='mt-2'
                controlId='passwordCustomValidation02'
              >
                <Form.Label>Comfirm Password</Form.Label>
                <Form.Control
                  type='password'
                  name='comfirmPassword'
                  placeholder='Password'
                  required
                  onChange={onChangeHandler}
                  value={registerData.comfirmPassword}
                  isInvalid={
                    validated &&
                    registerData.password !== registerData.confirmPassword
                  }
                />
                {validated &&
                  registerData.password !== registerData.confirmPassword && (
                    <Form.Control.Feedback type='invalid'>
                      Passwords must match.
                    </Form.Control.Feedback>
                  )}
              </Form.Group>
              <Row className='mt-3'>
                <Col lg={4} xs={4}>
                  <Button type='submit'>Register</Button>
                </Col>
                <Col className='d-flex align-items-center text-end'>
                  <Container className='px-0'>
                    <span className='me-2'>Have an account?</span>
                    <Link to={'/login'}>Login here</Link>
                  </Container>
                </Col>
              </Row>
            </Form>
          </Container>
        </Col>
        <Col />
      </Row>
    </Container>
  );
}

export default Register;
